var UserPaintings = [];

//Socket io setup
io.sockets.on('connection', function (socket) {

	socket.on('identification', function(data){
		if(data.role === 'newcomer'){
			LinkedConnection[socket.id] = 'connected';
			socket.emit('initialData', {table: tables, merge: mergedXY, color: JSON.stringify(colorXY)});
		}
	});

	//on color update
	socket.on('colorUpdate', function(data){
		colorXY[data.index/10] = data.color;	
		socket.broadcast.emit('getUpdatedColor', data);
	});
	
	//on user save image
	socket.on('savedImage', function(data){
		UserPaintings.push(data);
		if(UserPaintings.length>30)
			UserPaintings.shift();
		socket.emit('savedImageCallback', 'Successfully');
	});
	
	//on user request images
	socket.on('getImages',function(){
		socket.emit('userImages', JSON.stringify(UserPaintings));
	});
});